    <script>// Pandoc 2.9 adds attributes on both header and div. We remove the former (to
// be compatible with the behavior of Pandoc < 2.8).
document.addEventListener('DOMContentLoaded', function(e) {
  var hs = document.querySelectorAll("div.section[class*='level'] > :first-child");
  var i, h, a;
  for (i = 0; i < hs.length; i++) {
    h = hs[i];
    if (!/^h[1-6]$/i.test(h.tagName)) continue;  // it should be a header h1-h6
    a = h.attributes;
    while (a.length > 0) h.removeAttribute(a[0].name);
  }
});
</script>

# Probabilit

---
# Le distribuzioni di probabilit in R

Ci sono tantissime distribuzioni implementate in R, e molte altre caricando specifici pacchetti. `t`, `norm`, `gamma`, `beta`, `poisson`, `exp`, `chisq`, `binom`, ...

--

Tutte queste distribuzioni possono essere combinate con 4 funzioni: `r`, `q`, `d` e `p`:

- `rnorm`: genera numeri da una distribuzione normale (molto utile per simulare dati)
- `dnorm`: calcola la densit di probabilit
- `pnorm`: calcola la probabilit cumulata dato un quantile
- `qnorm`: calcola il quantile data la probabilit cumulata

---
# Distribuzione Normale - `rnorm`


```r
par(mfrow = c(1,3))
d1 &lt;- rnorm(n = 1000, mean = 100, sd = 5)
d2 &lt;- rnorm(n = 1000, mean = 100, sd = 10)
d3 &lt;- rnorm(n = 1000, mean = 100, sd = 50)
hist(d1, xlim = c(100-3*50, 100+3*50))
hist(d2, col = &quot;lightblue&quot;, xlim = c(100-3*50, 100+3*50))
hist(d3, col = &quot;salmon&quot;, xlim = c(100-3*50, 100+3*50))
```

&lt;img src=&quot;data:image/png;base64,#lezione3_files/figure-html/unnamed-chunk-1-1.svg&quot; width=&quot;100%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

---
# Distribuzione Normale - `rnorm`

Il parametro critico di `rnorm`  la numerosit. Pi osservazioni generiamo pi la nostra distribuzione  precisa.

&lt;img src=&quot;data:image/png;base64,#lezione3_files/figure-html/unnamed-chunk-2-1.svg&quot; width=&quot;60%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

# Distribuzione Normale - `pnorm`

Usiamo una la funzione `ggnorm` per rappresentare `pnorm()`


```r
ggnorm(q = 0.5, mean = 0, sd = 1, lower.tail = TRUE) # pnorm(0.5, 0, 1, TRUE)
```

&lt;img src=&quot;data:image/png;base64,#lezione3_files/figure-html/unnamed-chunk-3-1.svg&quot; width=&quot;60%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

---
# Distribuzione Normale - `pnorm`

Possiamo anche avere un&#39;area delimitata da 2 quantili


```r
ggnorm(q = c(-1, 1), mean = 0, sd = 1) # pnorm(1, 0, 1) - pnorm(-1, 0, 1)
```

&lt;img src=&quot;data:image/png;base64,#lezione3_files/figure-html/unnamed-chunk-4-1.svg&quot; width=&quot;60%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

---
# Distribuzione Normale - `pnorm`

.font70[

Possiamo anche rappresentare il complementare


```r
ggnorm(q = c(-1, 1), mean = 0, sd = 1, lower.tail = FALSE) # pnorm(-1, 0, 1, lower.tail = TRUE) + pnorm(1, 0, 1, lower.tail = FALSE)
```

&lt;img src=&quot;data:image/png;base64,#lezione3_files/figure-html/unnamed-chunk-5-1.svg&quot; width=&quot;50%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

]

---
# Distribuzione Normale - `qnorm`

.font70[

`qnorm`  l&#39;operazione complementare di `pnorm`. Se vogliamo sapere il quantile associato ad una certa probabilit comulata `\(p\)` facciamo `qnorm(p, mean, sd)`


```r
cumprob &lt;- 0.2 # da -Inf a q
q &lt;- round(qnorm(cumprob, 0, 1), 3)

ggnorm(q = q, mean = 0, sd = 1) +
  geom_point(x = q, 
             y = 0, 
             size = 3,
             color = &quot;red&quot;) +
  theme(plot.title = element_text(size = 12))
```

&lt;img src=&quot;data:image/png;base64,#lezione3_files/figure-html/unnamed-chunk-6-1.svg&quot; width=&quot;50%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

]

---
# Distribuzione Normale - `dnorm`

.font70[

Con `dnorm` calcoliamo la densit di probabilit di un quantile. In termini pratici corrisponde all&#39;asse `\(y\)` dei nostri grafici:


```r
ggnorm(q = q, mean = 0, sd = 1) +
  geom_point(x = q, 
             y = dnorm(q, 0, 1), 
             size = 3, 
             col = &quot;red&quot;)
```

&lt;img src=&quot;data:image/png;base64,#lezione3_files/figure-html/unnamed-chunk-7-1.svg&quot; width=&quot;50%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;
]

# Esercizi 

---
# Esercizi 

.font80[

Supponiamo che il punteggio X di un test sullansia segua una distribuzione normale con:

- media `\(\mu = 50\)`
- deviazione standard `\(\sigma = 6\)`

]


```r
ggnorm(mean = 50, sd = 6)
```

# Esercizi 

Calcolare la probabilit che un soggetto scelto a caso abbia un punteggio:

1. inferiore a 45
2. superiore a 60
3. compreso tra 55 e 65
4. inferiore alla media meno una deviazione standard
5. superiore alla media pi una deviazione standard
6. superiore alla media pi 4 deviazioni standard

---
# Soluzioni


```r
mu &lt;- 50
sigma &lt;- 6
```


```r
pnorm(45, mu, sigma)
```

```
## [1] 0.2023284
```

```r
1 - pnorm(45, mu, sigma) # pnorm(45, mu, sigma, lower.tail = FALSE)
```

```
## [1] 0.7976716
```

```r
pnorm(65, mean=mu, sd=sigma) - pnorm(55, mean=mu, sd=sigma)
```

```
## [1] 0.1961187
```

```r
pnorm(mu - sigma, mean=mu, sd=sigma)
```

```
## [1] 0.1586553
```

```r
1 - pnorm(mu + sigma, mean=mu, sd=sigma)
```

```
## [1] 0.1586553
```

# Esercizi 

Calcolare la probabilit che un soggetto scelto a caso abbia un punteggio che non si
discosta dalla media pi di

1. una deviazione standard
2. 2 deviazioni standard
3. 3 deviazioni standard

Calcolare

5. il 95-esimo percentile della distribuzione dei punteggi
6. il rango percentile associato a un soggetto che ha ottenuto un punteggio di 43

---
# Soluzioni


```r
a &lt;- mu - sigma
b &lt;- mu + sigma
pnorm(b, mean=mu, sd=sigma) - pnorm(a, mean=mu, sd=sigma)
```

```
## [1] 0.6826895
```

```r
a &lt;- mu - 2*sigma
b &lt;- mu + 2*sigma
pnorm(b, mean=mu, sd=sigma) - pnorm(a, mean=mu, sd=sigma)
```

```
## [1] 0.9544997
```

```r
a &lt;- mu - 3*sigma
b &lt;- mu + 3*sigma
pnorm(b, mean=mu, sd=sigma) - pnorm(a, mean=mu, sd=sigma)
```

```
## [1] 0.9973002
```

```r

x

## [1] 0.95

```

## [1] 12.2
```

```

# Punti Z

---
# Punti Z

.font70[

I punti Z si calcolano `\(z_i = \frac{x_i - \mu}{\sigma}\)`. Vediamo passo per passo: generiamo dei dati da una distribuzione normale con media `\(\mu = 100\)` e deviazione standard `\(\sigma = 20\)`:


```r
dat &lt;- data.frame(y = rnorm(100, 100, 20))
```


```r
ggplot(dat, aes(x = y)) +
  geom_histogram(bins = 20, color = &quot;black&quot;, fill = &quot;lightblue&quot;) +
  theme_minimal(base_size = 15)
```

&lt;img src=&quot;data:image/png;base64,#lezione3_files/figure-html/unnamed-chunk-14-1.svg&quot; width=&quot;50%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

]

---
# Punti Z

Prima sottraiamo la media da ogni valore `\(x_{cen} = x_i - \mu\)`. Se un valore  vicino alla media avr un punteggio vicino a 0:

&lt;img src=&quot;data:image/png;base64,#lezione3_files/figure-html/unnamed-chunk-15-1.svg&quot; width=&quot;60%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

---
# Punti Z

Poi calcoliamo e rappresentiamo la deviazione standard che  `\(\sigma = \sqrt{\frac{\sum_{i = 1}^N(x_i - \mu_x)^2}{N}}\)` (la radice quadrata della media degli scarti al quadrato):

&lt;img src=&quot;data:image/png;base64,#lezione3_files/figure-html/unnamed-chunk-16-1.svg&quot; width=&quot;60%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

---
# Punti Z

Infine dividiamo ogni scarto dalla media per la deviazione standard `\(z_i = \frac{x_i - \mu}{\sigma}\)`. In questo modo uno scarto che  vicino alla deviazione standard prender il valore ~ 1 e cos rapportato a tutte le distanze:

&lt;img src=&quot;data:image/png;base64,#lezione3_files/figure-html/unnamed-chunk-17-1.svg&quot; width=&quot;60%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

---
# Punti Z

Trasformare dei dati grezzi in punti z  un modo molto utile per interpretarli:


```r
mu &lt;- 10
sigma &lt;- 4
n &lt;- 10

datz &lt;- data.frame(
  id = 1:n,
  y = rnorm(n, mu, sigma)
)

datz
```

```
##    id         y
## 1   1 13.913118
## 2   2 10.250330
## 3   3 10.872929
## 4   4 14.193387
## 5   5  5.217891
## 6   6  2.959409
## 7   7 12.005541
## 8   8  6.508148
## 9   9  7.308680
## 10 10 10.859862
```

---
# Punti Z

Calcoliamo i punti z rispetto ai valori normativi con `\(z_i = \frac{x_i - \mu}{\sigma}\)`:


```r
datz$yz &lt;- (datz$y - mu)/sigma
datz$yz
```

```
##  [1]  0.97827951  0.06258247  0.21823213  1.04834672 -1.19552734 -1.76014764
##  [7]  0.50138527 -0.87296289 -0.67283009  0.21496545
```

# ggplot2

Ma la potenza di `ggplot` si vede nella semplicit nel creare grafici complessi. Prendiamo i dati della lezione precedente:


```r
dat &lt;- read.csv(&quot;../../data/psych.csv&quot;, header = TRUE, sep = &quot;;&quot;) # importare
dat &lt;- dat[complete.cases(dat), ]
```

Facciamo uno `scatterplot` della relazione tra `eta` e `depressione` per ogni `diagnosi` colorando in base al `ses`:


```r
ggplot(dat, aes(x = eta, y = dep_score, color = ses)) +
  geom_point() +
  facet_wrap(~diagnosi)
```
